public class MobilePageModel {
	
	private String mobileId;
	private String mobileCode;
	private String mobileName;
	private String mobileUrl;
	
	/**
	 * @return the mobileId
	 */
	public String getMobileId() {
		return mobileId;
	}
	/**
	 * @param mobileId the mobileId to set
	 */
	public void setMobileId(String mobileId) {
		this.mobileId = mobileId;
	}
	/**
	 * @return the mobileCode
	 */
	public String getMobileCode() {
		return mobileCode;
	}
	/**
	 * @param mobileCode the mobileCode to set
	 */
	public void setMobileCode(String mobileCode) {
		this.mobileCode = mobileCode;
	}
	/**
	 * @return the mobileName
	 */
	public String getMobileName() {
		return mobileName;
	}
	/**
	 * @param mobileName the mobileName to set
	 */
	public void setMobileName(String mobileName) {
		this.mobileName = mobileName;
	}
	/**
	 * @return the mobileUrl
	 */
	public String getMobileUrl() {
		return mobileUrl;
	}
	/**
	 * @param mobileUrl the mobileUrl to set
	 */
	public void setMobileUrl(String mobileUrl) {
		this.mobileUrl = mobileUrl;
	}

}
